import React from "react";

export const CartItem = ({ product }) => {
  return (
    <div>
      <div className="border rounded-md p-3 pb-4 flex w-full gap-8">
        <div className="object-contain w-1/5">
          <img
            src={product.url}
            className="w-full h-auto object-contain"
            alt=""
          />
        </div>
        <div className="flex gap-2 text-sm">
          <h6 className="font-semibold font-titleFont">{product.name}</h6>
        </div>
      </div>
    </div>
  );
};
